let ogElemListener = Element.prototype.addEventListener;
Element.prototype.addEventListener = function(eventType, callback, ...args) {
    console.log("nice try elem version " + eventType);
    if(eventType === "paste") {
        return ogElemListener.call(this, "paste", function(e, ...rest) {
            console.log("WRAPPER AROUND", e);//<<<

            //<<< let newItems = [];
            //<<< newItems.append(...)
            //<<< for item in oldItems
            //<<<    newItems.append(item)

            let fakeClipboardData = new DataTransfer();
            fakeClipboardData.items.add(buildFile());
            let fakeE = {
                type: e.type,
                clipboardData: fakeClipboardData,
            };
            return callback.call(this, fakeE, ...rest);
        }, ...args);
    } else {
        return ogElemListener.call(this, eventType, callback, ...args);
    }
};

function buildFile() {

    var contentType = 'image/gif';
    var b64Data = '';

    var blob = b64toBlob(b64Data, contentType);
    var parts = [blob];

    // Construct a file
    var file = new File(parts, 'sample.txt', {
        lastModified: new Date(0), // optional - default = now
        type: "image/gif", // optional - default = ''
    });
    return file;
}

function b64toBlob(b64Data, contentType, sliceSize) {
  contentType = contentType || '';
  sliceSize = sliceSize || 512;

  var byteCharacters = atob(b64Data);
  var byteArrays = [];

  for (var offset = 0; offset < byteCharacters.length; offset += sliceSize) {
    var slice = byteCharacters.slice(offset, offset + sliceSize);

    var byteNumbers = new Array(slice.length);
    for (var i = 0; i < slice.length; i++) {
      byteNumbers[i] = slice.charCodeAt(i);
    }

    var byteArray = new Uint8Array(byteNumbers);

    byteArrays.push(byteArray);
  }

  var blob = new Blob(byteArrays, {type: contentType});
  return blob;
}


let ogDocListener = document.addEventListener;
document.addEventListener = function(eventType, ...args) {
    console.log("nice try " + eventType);
    return ogDocListener(eventType, ...args);
};
let ogWindowListener = window.addEventListener;
window.addEventListener = function(eventType, ...args) {
    console.log("nice try 2 " + eventType);
    return ogWindowListener(eventType, ...args);
};
